import React from "react";

function Navbar({ setPage }) {
  return (
    <nav style={styles.nav}>
      <h1 style={styles.logo}>ðŸŽ¥ MovieApp</h1>
      <div>
        <button style={styles.button} onClick={() => setPage("home")}>Home</button>
        <button style={styles.button} onClick={() => setPage("favorites")}>Favorites</button>
      </div>
    </nav>
  );
}

const styles = {
  nav: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "10px 20px",
    backgroundColor: "#111",
    color: "white",
  },
  logo: {
    margin: 0,
  },
  button: {
    marginLeft: "10px",
    padding: "5px 10px",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    backgroundColor: "#ffd700",
    fontWeight: "bold",
  },
};

export default Navbar;
